var tabs = {};


class Dimensions {
    constructor(tab) {
        this.tab = tab;
        chrome.tabs.executeScript(this.tab.id, { file: 'tooltip.js' });
        this.worker = new Worker("dimensions.js");
        this.worker.onmessage = this.receiveWorkerMessage.bind(this);
    }

    initialize(port) {
        this.port = port;
        this.port.onMessage.addListener(this.receiveBrowserMessage.bind(this));
    }

    receiveWorkerMessage(event) {
        const forward = ['worker -> background -> browser'];
        if (forward.indexOf(event.data.type) > -1) {
            this.port.postMessage(event.data);
        }
    }

    do() {
        const image = new Image();
        const canvas = document.createElement('canvas');
        image.src = imgDataUrl;
        canvas.width = this.tab.width;
        canvas.height = this.tab.height;

        const ctx = canvas.getContext('2d');
        ctx.drawImage(image, 0, 0, canvas.width, canvas.height);
        const imgData = JSON.stringify({ data: ctx.getImageData(0, 0, canvas.width, canvas.height).data });

        console.log('background sended: ', imgData);

        this.port.postMessage({
            type: 'background -> browser',
            data: imgData
        });
    }

    receiveBrowserMessage(event) {
        const forward = ['browser -> background -> worker'];
        if (forward.indexOf(event.type) > -1) {
            this.worker.postMessage(event);
        }

        switch (event.type) {
            case 'do':
                this.do();
                break;
        }
    }

}

chrome.browserAction.onClicked.addListener((tab) => {
    tabs[tab.id] = new Dimensions(tab);
});

chrome.runtime.onConnect.addListener((port) => {
    tabs[port.sender.tab.id].initialize(port);
});

const imgDataUrl = "data:image/png;base64,";
